import React, { useState, useEffect } from 'react';
import {BrowserRouter, Route} from 'react-router-dom'
import PageLogin from './PageLogin';
const App = () => {
  return (
    <BrowserRouter>
        <Route exact path='/login'>
          <PageLogin/>
        </Route>
    </BrowserRouter>
  );
};

export default App;
